import { Component } from '@angular/core';

@Component({
  selector: 'app-parallaxe',
  templateUrl: './parallaxe.component.html',
  styleUrls: ['./parallaxe.component.scss']
})
export class ParallaxeComponent {
  layer_0!: '/src/assets/parallaxe/layer_0.png';
}
